package com.nafil.recyclerview;

import androidx.appcompat.app.AppCompatActivity;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import android.content.Context;
import android.os.Bundle;

import java.util.ArrayList;

public class MainActivity extends AppCompatActivity {

    private ArrayList<String> logoklub = new ArrayList<>();
    private ArrayList<String> namaklub = new ArrayList<>();
    private ArrayList<String> tanggalklub = new ArrayList<>();
    private ArrayList<String> julukanklub = new ArrayList<>();
    private ArrayList<String> daerahklub = new ArrayList<>();
    private ArrayList<String> deskripsiklub = new ArrayList<>();

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        getDataFromInternet(); //Menjalankan method
    }
    //Method untuk memproses RecyclerView
    protected  void prosesRecyclerViewAdapter(){

        RecyclerView recyclerView = findViewById(R.id.rcvKlub); //Deklarasi object yang akan digunakan
        RecyclerViewAdapter adapter = new RecyclerViewAdapter(logoklub, namaklub, tanggalklub, julukanklub, daerahklub, deskripsiklub, this);

        recyclerView.setAdapter(adapter);
        recyclerView.setLayoutManager(new LinearLayoutManager(this));
    }

    private void getDataFromInternet(){
        //Barcelona
        namaklub.add("Barcelona");
        tanggalklub.add("29 November 1899");
        logoklub.add("https://th.bing.com/th/id/OIP.QBkuMwdtEgCZ6Ta626e0vAAAAA?w=314&h=179&c=7&r=0&o=5&dpr=1.5&pid=1.7");
        julukanklub.add("barca");
        daerahklub.add("Spanyol");
        deskripsiklub.add("Barcelona merupakan sebuah club sepakbola dunia yang ditakuti beberapa club.");

        //Juventus
        namaklub.add("Juventus");
        tanggalklub.add("1 November 1897");
        logoklub.add("https://th.bing.com/th/id/OIP.wTx1p-rdXmNuL_dA6q6xQQHaE7?w=241&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7");
        julukanklub.add("Si Nyonya Besar");
        daerahklub.add("Italia");
        deskripsiklub.add("Juventus merupakan salah satu club hebat didunia");

        //Manchester United
        namaklub.add("Manchester United");
        tanggalklub.add("tahun 1878");
        logoklub.add("data:image/jpeg;base64,");
        julukanklub.add("Setan Merah");
        daerahklub.add("Britania Raya");
        deskripsiklub.add("Manchester United merupakan club dengan julukan setan merah dan merupakan club besar.");

        prosesRecyclerViewAdapter();
    }
}